import React from 'react';
import './App.css';
import Contact from './components/Contact';
import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <Header branding="Contact Manager" />
      <Contact />
      <Contact name="Lisa" email="lisa@gmail.com" phone="8888888888" />
    </div>

  );
}

export default App;
